import React from 'react';
const FixedSideNav = ()=>{
  const links = [{id:'about',label:'About'},{id:'services',label:'Services'},{id:'products',label:'Products'},{id:'careers',label:'Careers'},{id:'contact',label:'Contact'}];
  return (
    <div className="side-nav hidden md:block">
      {links.map(l=> <a key={l.id} href={'#'+l.id}>{l.label}</a>)}
    </div>
  );
}
export default FixedSideNav;
